export default function Header({dateMonth}){
    function translateMonth () {
        let month = dateMonth.slice(5,7);
        let year = dateMonth.slice(0,4);
        let monthArray = ["Gennaio", "Febbraio", "Marzo", "Aprile"]
        dateMonth = monthArray[month - 1] + " " + year;
    }
    translateMonth()
    return(
        <header>
        <h1 className="title">Pagina rimborso di {dateMonth}</h1>

        <nav>
            <button className="goHome">Home</button>
        </nav>
    </header>
    )
}
